import { FETCH_POSTS, FETCH_POST_DETAILS } from '../actions'

const initialState = {
    posts: [{}],
}

function posts(state = initialState, action) {
    const { allPosts } = action
    switch (action.type) {
        case FETCH_POSTS:
            return {
                ...state
            }
        default:
            return state
    }
}

export default posts;
